Information
------------------------------

Star Paws The Rise Of Superstar Pets
Cute kittens, excitable puppies and professional pets - the advertising industry wants them all. Inspired by the popularity of humorous online videos and internet celebrities like Grumpy Cat, who has lent her face to a range of products including calendars, mugs and T-shirts, pets are now big business. This Cutting Edge documentary tells the story of the animal agents and owners whose job it is to supply a new wave of four-legged stars to appear in some of the world's favourite adverts.
Every day in the UK we share 3.8 million pictures and clips of kittens online. So while the advertising industry has always known that cute animals sell product (think the Dulux dog or Andrex puppies), they've tapped into this version of our animal obsession and now cats like Bronte or Grumpy Cat, who became celebrities by going viral on YouTube, are treated as proper stars. They are a brand.
If you've ever lost a few hours of your life scrolling through footage of cats playing the piano or let out an involuntary &quot;ahhhh&quot; when you see a Labrador puppy rolling around, you'll love this documentary. It's wall-to-wall cuteness.

